import React from 'react';
import RootNavigator from './';

const App = () => {
  return (
    <RootNavigator />
  );
}

export default App;

const styles = StyleSheet.create({
  container: {
    padding: theme.spacing.medium,
    backgroundColor: theme.colors.primary.main,
  },
});
